import logo from './logo.svg';
import tokyo from './tokyo.jpg'
import './App.css';

function App() {
  let edad=27;
  return (
    <>
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
         <p>Mi edad es {edad}</p>
      </header>
    </div>
    <p>Hola mundo</p>
    </>
  );
}

export default App;
